        //this.container.innerText=utils.zip(this.basesvg);


        this.moonsvg=utils._createSVGElementSet(this.container, this.imgWidth,this.imgHeight,135,135);

        //this.moonsvg.innerHTML=this.uncompresssvg;
        this.moonsvg.innerHTML=this.basesvg;
        

        this.cover=utils._createElement(this.moonsvg, "path");
